import "./App.css";
import { useState, useEffect } from "react";
function App() {
  useEffect(() => {
    const fetchMovie = async () => {
      const URL = "http://www.omdbapi.com/?i=tt3896198&apikey=e45311a3";
      const response = await fetch(URL);
      const finalData = response.json();
      console.log(finalData);
    };
    fetchMovie();
  }, []);
}

export default App;
